import re


# Function to find CTF patterns in a file
def find_ctf_patterns(filename):
    try:
        with open(filename, 'r') as file:
            content = file.read()
            ctf_patterns = re.findall(r'NOON_CTF{[^}]+}', content)
            return ctf_patterns
    except FileNotFoundError:
        print(f"Error: File '{filename}' not found.")
        return []


def main():
    # File containing the CTF patterns
    filename = 'CTF_Match.txt'
    
    # Find CTF patterns in the file
    ctf_patterns = find_ctf_patterns(filename)
    
    # Display the CTF patterns found in the file (if any)
    if ctf_patterns:
        print("Found the following CTF patterns:")
        for pattern in ctf_patterns:
            print(pattern)
    else:
        print("No CTF patterns found in the file.")


if __name__ == "__main__":
    main()

class Solution {
  public:
  
    // Function to detect cycle in an undirected graph.
 
    bool dfs(int node, int parent, vector<int> adj[], vector<bool> & visited) {
        visited[node] = true;
        for(int neigh : adj[node]) {
            if(!visited[neigh] ) {
                 if(dfs(neigh, node, adj, visited)) {
                     return true;
                 }
            }
            else if(neigh != parent) {
                return true;
            }
        }
        return false;
    }
    bool isCycle(int V, vector<int> adj[]) {
        bool res = false;
        vector<bool> visited(V + 2, false);
        for(int i = 0; i < V; i++) {
            if(!visited[i]) {
                if(dfs(i, -1, adj, visited)) {
                    return true;
                }
                }
            
        }
        return false;
    }
};

#include <vector>
#include <set>
